import { useSelector } from "react-redux";
import { login } from "../api/Api";
import { instanceAxs } from "../api/Api";

const isLoggedReducer =  (state = false, action) => {
    switch (action.type) {
        case "SIGN_IN":
            instanceAxs.post('/login', action.payload)
                .then(response => {
                    console.log(action.payload)
                    const message = response.data.message;
                    console.log(message)
                    if(message === "user logged in") {
                        return state = true
                    } else {
                        return state = true;
                    }
                })   
                .catch(error => {
                    console.log(error)
                })
            return state;
        case "SIGN_OUT":
            return state = false
        default:
            return state;
    }
}

export function LoggedSelector(){
    return useSelector(state => state.isLogged);
}

export default isLoggedReducer;
